document.querySelectorAll('.category').forEach(item => {
    item.addEventListener('dragstart', dragStart);
});

document.querySelectorAll('.drop-zone').forEach(zone => {
    zone.addEventListener('dragover', dragOver);
    zone.addEventListener('drop', drop);
});

function dragStart(e) {
    e.dataTransfer.setData("text/plain", e.target.innerText);
}

function dragOver(e) {
    e.preventDefault();
}

function drop(e) {
    e.preventDefault();
    const data = e.dataTransfer.getData("text/plain");
    e.target.innerText = data;
    updateResults();
}

function updateResults() {
    const zone1 = document.getElementById('drop-zone-1').innerText;
    const zone2 = document.getElementById('drop-zone-2').innerText;
    const resultsDiv = document.getElementById('results');
    resultsDiv.innerHTML = ''; // 使用innerHTML以便能够添加HTML元素

    // 检查是否有相应的数据，并且按照逻辑展示结果
    if (zone1 && zone2 && resultsData[zone2] && resultsData[zone2][zone1]) {
        const titles = resultsData[zone2][zone1];
        // 在"节目是:"的冒号下方添加额外的换行
        resultsDiv.innerHTML = `<p>最像 "${zone1}" 的 "${zone2}" 节目是:</p><br>`;
        titles.forEach(([title, distance, url]) => {
            // 为每个标题创建一个超链接
            const link = document.createElement('a');
            link.href = url; // 设置超链接的URL
            link.textContent = `${title} -- (距离: ${distance})`; // 设置链接文本
            link.target = "_blank"; // 在新标签页中打开链接
            resultsDiv.appendChild(link);
            resultsDiv.appendChild(document.createElement('br')); // 在每个链接后添加一个换行
            resultsDiv.appendChild(document.createElement('br'));
        });
    }
}